INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 4, "カオリ（サマー）", 110501, 10021, 0.0, 4, 0.0, 0.0, 24, 24015, "2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 1, "カオリ（サマー）", 110501, 10021, 4.0, 4, 0.0, 0.0, 24, 24016, "2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 4, "カオリ（サマー）", 110501, 10021, 0.0, 4, 0.0, 0.0, 24, 24017, "2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 2, "カオリ（サマー）", 110501, 10021, 5.2, 1, 0.0, 0.0, 24, 24018, "2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 6, "カオリ（サマー）", 110501, 10021, 4.2, 5, 0.0, 0.0, 24, 24019, "2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 2, "カオリ（サマー）", 110501, 10021, 0.0, 2, 0.0, 0.0, 24, 24020, "2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 6, "カオリ（サマー）", 110501, 10021, 6.4, 1, 0.0, 0.0, 24, 24021, "2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 2, "カオリ（サマー）", 110501, 10021, 0.0, 2, 0.0, 0.0, 24, 24022, "2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 3, "カオリ（サマー）", 110501, 10021, 10.08, 6, 0.0, 0.0, 24, 24023, "2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 2, "カオリ（サマー）", 110501, 10021, 5.0, 1, 0.0, 0.0, 24, 24024, "2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES ("2019/07/31 12:00:00", 2, "カオリ（サマー）", 110501, 10021, 0.0, 2, 0.0, 0.0, 24, 24025, "2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11);
